import React, { lazy } from 'react';
import { Switch, Route } from 'react-router-dom';
import { useRouteMatch } from 'react-router-dom/cjs/react-router-dom.min';

const AddAdvertisement = lazy(() => import('../../container/advertisement/AddAdvertisement'));
const ListAdvertisement = lazy(() => import('../../container/advertisement/ListAdvertisement'));
const EditAdvertisement = lazy(() => import('../../container/advertisement/EditAdvertisement'));

const Advertisement = () => {
  const { path } = useRouteMatch();
  return (
    <Switch>
      <Route exact path={`${path}/addAdvertisement`} component={AddAdvertisement} />
      <Route exact path={`${path}/listAdvertisement`} component={ListAdvertisement} />
      <Route exact path={`${path}/editAdvertisement/:adsId`} component={EditAdvertisement} />
    </Switch>
  );
};

export default Advertisement;
